import { useEffect, useState } from 'react';
import axios from 'axios';

export default function AdminDashboard() {
  const [feedbacks, setFeedbacks] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const token = localStorage.getItem('token');
        const res = await axios.get('http://localhost:5000/api/feedbacks', {
          headers: { Authorization: `Bearer ${token}` }
        });

        if (Array.isArray(res.data)) {
          setFeedbacks(res.data);
        } else {
          console.error("Expected an array, got:", res.data);
          setError("Invalid data format from server.");
        }

      } catch (err) {
        console.error("Error fetching feedbacks:", err);
        setError("Failed to load feedbacks.");
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold mb-6 text-center text-blue-800">Feedback Dashboard</h1>

      {loading ? (
        <p className="text-center">Loading...</p>
      ) : error ? (
        <p className="text-center text-red-500">{error}</p>
      ) : feedbacks.length === 0 ? (
        <p className="text-center text-gray-500">No feedbacks found.</p>
      ) : (
        <div className="overflow-x-auto">
          <table className="min-w-full bg-white border shadow">
            <thead className="bg-gray-100">
              <tr>
                <th className="py-2 px-4 border">Name</th>
                <th className="py-2 px-4 border">Course</th>
                <th className="py-2 px-4 border">Rating</th>
                <th className="py-2 px-4 border">Comments</th>
              </tr>
            </thead>
            <tbody>
              {feedbacks.map((feedback) => (
                <tr key={feedback._id} className="hover:bg-gray-50">
                  <td className="py-2 px-4 border">{feedback.name}</td>
                  <td className="py-2 px-4 border">{feedback.course}</td>
                  <td className="py-2 px-4 border text-yellow-500">
                    {Array(feedback.rating).fill('⭐').join('')}
                  </td>
                  <td className="py-2 px-4 border">{feedback.comments}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}
